import {BrowserRouter, Route} from 'react-router-dom'

function App() {
  return (

    <div className="App">
      <Header/>
        <Nav/>
       {/* <Content/> */}
       <Dialogs/>
       <Route/>
    </div>  
  );
}

export default App;
